style.css:
/* Global Styles */
body {
  font-family: 'Helvetica Neue', Arial, sans-serif;
  background-color: #f4f4f4;
  color: #333;
}

/* Header Styles */
header {
  background-color: #2c3e50;
  color: #ecf0f1;
  padding: 20px;
  text-align: center;
}

/* Navigation Styles */
nav {
  background-color: #34495e;
  padding: 10px;
}

nav a {
  color: #ecf0f1;
  text-decoration: none;
  padding: 8px 15px;
  margin: 0 5px;
  border-radius: 5px;
}

nav a:hover {
  background-color: #2c3e50;
}

/* Main Content Styles */
main {
  padding: 20px;
}

/* Footer Styles */
footer {
  background-color: #2c3e50;
  color: #ecf0f1;
  padding: 10px;
  text-align: center;
}

/* Button Styles */
button {
  background-color: #3498db;
  color: #ecf0f1;
  padding: 10px 15px;
  border: none;
  border-radius: 5px;
  cursor: pointer;
}

button:hover {
  background-color: #2980b9;
}
